import React, { Component } from 'react'
import s from './Main.module.css'

class Main extends Component {
    render() {
        return (
            <div>
                {this.props.items.map(el => (
                    <h1>{el.title}</h1>
                ))}
            </div>
        )
    }
}

export default Main
